/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `before_order_item_insert` BEFORE INSERT ON `order_items` FOR EACH ROW BEGIN
    -- Declare a variable to store the fetched price:
    DECLARE product_price DECIMAL(10, 2);

    -- If no price is provided during the INSERT operation:
    IF NEW.price IS NULL THEN
        
        -- Fetch the price based on the product_id from the products table:
        SELECT price INTO product_price
        FROM products
        WHERE product_id = NEW.product_id;
        
        -- Set the fetched price to the NEW.price:
        SET NEW.price = product_price;
    END IF;
    
    -- Always calculate the total_price using the NEW.price:
    SET NEW.total_price = NEW.quantity * NEW.price;
END */;;
DELIMITER ;
